import React, { Component } from 'react';

 function helloSelvy(opts) {
  console.log('Posting request to Selvy Chatbot API...');
  fetch('http://192.168.219.129:8080', {
    method: 'post',
    headers: new Headers({
      'Content-Type': 'application/json'
    }),
    body: JSON.stringify(opts)
  })
  .then(function (res) {  
    console.log('Request success: ', res.json()); 
    //return JSON.parse(res);
  })
  .then(function(data) {
    for (var i = 0; i < data.products.length; i++) {
      var listItem = document.createElement('li');
      /*
      listItem.innerHTML = '<strong>' + data.products[i].Name + '</strong> can be found in ' +
                           data.products[i].Location +
                           '. Cost: <strong>£' + data.products[i].Price + '</strong>';
      myList.appendChild(listItem);
      */
     console.log()
    }
  }) 
  .catch(function (error) {  
    console.log('Request failure: ', error);  
  });
}

function submit() {
  var item =  helloSelvy({
    user_id:'claude',
    msg:'야근 교통비'
  });
  //var item = JSON.parse(userStr);
  console.log(item.status);
}

class App extends Component {
   render() {
    return (
      <div>
        <button onClick={submit}>submit</button>
      </div>
    );
  }
}

export default App;
